  useEffect(()=>{
    axios.get('/members').then(response => {
      console.log("SUCCESS", response)
      setData(response)
    }).catch(error => {
      console.log(error)
    })

  }, [])
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>React + Flask Tutorial</p>
      </header>
    {(typeof data.data.members=='undefined') ? (<p>Loading</p>) : (data.members.map((member,i) => (<p key={i}>{member}</p>)))}
    </div>
  );
}

export default App;
